import React from 'react';
import API from './Api';
import Container from '@material-ui/core/Container';
import TextField from '@material-ui/core/TextField';

import { makeStyles } from "@material-ui/core/styles";

const styles = theme => ({
    root: {
        "& label.Mui-focused": {
          color: "orange"
        },
        "& .MuiInput-underline:after": {
          borderBottomColor: "orange"
        }
    }
})

class BienesApi extends React.Component {
    
    

    async componentDidMount() {
        
        var headers = {
            "Access-Control-Allow-Origin":"*",
            "Access-Control-Allow-Methods":"GET, POST, PATCH, PUT, DELETE, OPTIONS",
            "Access-Control-Allow-Headers":"Origin, Content-Type, X-Auth-Token"
            }
        // Load async data.
            /*getRef.do?json={"id":"funRegistroGarantias"}*/
            //const response = await API.get('https://jsonplaceholder.typicode.com/todos/1');
        const response = API.get('getRef.do?json={"id":"funRegistroGarantias"}',{headers}).then(function (result){
            console.log('ðŸ‘‰ Returned data:', response);
        }).catch (function (error){
            console.log(`ðŸ˜± Axios request failed: ${error}`);
        });
    }
    render() {
        
        const classes = useStyles();
  const [age, setAge] = React.useState('');

  const handleChange = (event) => {
    setAge(event.target.value);
  };

        return (
            <div>
                <Container maxWidth="sm" style={{margin: "20px"}}>
                    <TextField id="" label="Fideicomiso" defaultValue="0000" classes={this.props.classes}/>
                    <TextField id="" label="Sub Fiso" defaultValue="0000" classes={this.props.classes}/>
                    <FormControl className={classes.formControl}>
                    <Select
                    value={age}
                    onChange={handleChange}
                    displayEmpty
                    className={classes.selectEmpty}
                    inputProps={{ 'aria-label': 'Without label' }}
                    >
                    <MenuItem value="" disabled>
                        Placeholder
                    </MenuItem>
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                    <FormHelperText>Placeholder</FormHelperText>
                </FormControl>
                    <TextField id="" label="Descripcion" defaultValue="0000" classes={this.props.classes}/>
                </Container>
            </div>
        );
    }
}
export default BienesApi;
